  `id` varchar(64) COLLATE utf8_bin NOT NULL COMMENT '编号',
  `area_id` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '归属区域',
  `equipment_name` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '设备名称',
  `serialnumber` varchar(100) COLLATE utf8_bin NOT NULL COMMENT '设备序列号',
  `ip` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT 'ip地址',
  `produce_area` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '产地',
  `buy_time` datetime DEFAULT NULL COMMENT '购买时间',
  `install_time` datetime DEFAULT NULL COMMENT '安装时间',
  `install_person` varchar(100) COLLATE utf8_bin DEFAULT NULL COMMENT '安装人',
  `flag` char(1) COLLATE utf8_bin DEFAULT NULL COMMENT '状态',
  `create_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '创建者',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '更新者',
  `update_date` datetime DEFAULT NULL COMMENT '更新时间',
  `remarks` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注信息',
  `del_flag` char(1) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '删除标记',
  `hardware_version` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '硬件版本',
  `software_version` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '软件版本',
  `system_version` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '系统版本',
  `vender` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '生产商',
  `end_device_appversion` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '手机App版本',
  `x` double(14,6) DEFAULT NULL COMMENT '经度',
  `y` double(14,6) DEFAULT NULL COMMENT '纬度',
  `status` int(1) NOT NULL DEFAULT '1' COMMENT '状态',
  `mac` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'MAC地址',
  `end_user_count` int(11) NOT NULL DEFAULT '0' COMMENT '手机连接个数',
  PRIMARY KEY (`id`),
  KEY `biz_equipment_name` (`equipment_name`),
  KEY `biz_equipment_serialnumber` (`serialnumber`),
  KEY `biz_equipment_del_flag` (`del_flag`),
  KEY `FK_equipment_id` (`area_id`),
  KEY `FK_equipment_user` (`install_person`),
  CONSTRAINT `FK_equipment_id` FOREIGN KEY (`area_id`) REFERENCES `area` (`id`),
  CONSTRAINT `FK_equipment_user` FOREIGN KEY (`install_person`) REFERENCES `sys_user` (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin COMMENT='设备表';

-- ----------------------------
-- Records of cms_device_info
-- ----------------------------

